import React, { useState } from 'react';
import './dashboard.css';
import DashboardBox from './Dashboard/dashboard_box';
import ExpenseTracker from '../expense/expense_tracker';
import PieChartComponent from './Dashboard/piechart';
import TotalBudget from './Dashboard/total_budget';
import UpcomingBills from './Dashboard/upcoming_bills';

const Dashboard = ({ }) => {
    const [currentPage, setCurrentPage] = useState('dashboard');

    const renderContent = () => {
        switch (currentPage) {
            case 'expense-tracker':
                return <ExpenseTracker />;
            case 'budget':
                return <TotalBudget />;
            case 'analytics':
                return <PieChartComponent />;
            case 'upcoming-bills':
                return <UpcomingBills />;
            default:
                return (
                    <div className="dashboard">
                        <div className="dashboard-container">
                            <div className="dashboard-grid">
                                <DashboardBox title="Expense Tracker" onClick={() => setCurrentPage('expense_tracker')} />
                                <DashboardBox title="Budget" onClick={() => setCurrentPage('total_budget')} />
                                <DashboardBox title="Analytics" onClick={() => setCurrentPage('piechart')} />
                                <DashboardBox title="Upcoming Bills" onClick={() => setCurrentPage('upcoming_bills')} />
                            </div>
                        </div>
                    </div>
                )}}
    }

export default Dashboard;
